import { useState } from "react";
import "./ToDo.scss";

interface ToDo {
    title: string;
    description: string;
}

const ToDo: React.FC = () => {
    const [toDo, setToDo] = useState<ToDo>({title: "", description: ""})
    const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        setToDo({[e.target.name]: e.target.value})
    }
  return (
    <div>
      <div className="container pt-3 pb-3">
        <div className="mb-3">
          <label>Title: </label>
          <input
            type="text"
            placeholder="enter title"
            className="input-title" onChange={handleChange} name="title"
          />
        </div>

        <div className="mb-3">
          <label>Description: </label>
          <input
            type="text"
            placeholder="enter description"
            className="input-desc" onChange={handleChange} name="description"
          />
        </div>

        <div>
          <button className="btn btn-primary">POST</button>
        </div>
      </div>
    </div>
  );
};

export default ToDo;
